script: |
  super -f text -I q10898.spq | sort > q10898.out

inputs:
  - name: q10898.spq
    data: |
      SELECT DISTINCT + + col0 + + col1 + + - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 NOT BETWEEN + col2 AND + 94;
  - name: tab0

outputs:
  - name: q10898.out
    data: |
      -1
      49
      98
